import React, { useState, useEffect } from 'react';
import "./HomeScreen.css";

export default function HomeScreen() {
  const [mountains, setMountains] = useState([]);

  const generateMountains = () => {
    let leftPos = 0;
    const arr = [];
    while (leftPos < 300) {
      const isFront = arr.length % 2 === 0;
      const h = isFront ? Math.floor(Math.random() * 150) + 1750 : Math.floor(Math.random() * 150) + 2650;
      const w = Math.floor(Math.random() * 200) + 1900;
      const s = Math.random() * 3;
      const l = leftPos + s;
      arr.push({ height: h, width: w, left: `${l}%`, isFront });
      leftPos = l + 9.5;
    }
    const mountainBefore = {
      height: Math.floor(Math.random() * 150) + 1750,
      width: Math.floor(Math.random() * 200) + 1900,
      left: "-5%",
      isFront: true
    };
    const mountainAfter = {
      height: Math.floor(Math.random() * 150) + 1750,
      width: Math.floor(Math.random() * 200) + 1900,
      left: "305%",
      isFront: false
    };
    arr.unshift(mountainBefore);
    arr.push(mountainAfter);
    return arr;
  };

  useEffect(() => {
    const handleResize = () => {
      setMountains(generateMountains());
    };
    handleResize();
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const rayCount = 18;
  const orbitRadius = 46;
  const minRayLength = 20;
  const maxRayLength = 25;
  const rays = Array.from({ length: rayCount }, (_, i) => {
    const angle = i * (360 / rayCount);
    const rayLength = Math.random() * (maxRayLength - minRayLength) + minRayLength;
    const randomDelay = Math.random() * 8;
    const randomDuration = Math.random() * 2 + 3;
    return (
      <div
        key={i}
        className="sun-ray"
        style={{
          width: `${rayLength}px`,
          transform: `rotate(${angle}deg) translateX(${orbitRadius}px)`,
          '--lineLength': `${rayLength}px`,
          animation: `bounce ${randomDuration}s linear infinite`,
          animationDelay: `${randomDelay}s`
        }}
      />
    );
  });

  function toggleFullscreen() {
    if (!document.fullscreenElement) {
      document.documentElement.requestFullscreen();
    } else {
      if (document.exitFullscreen) {
        document.exitFullscreen();
      }
    }
  }

  return (
    <div id="homescreen">
      <div className="mountain-container">
        {mountains.map((m, i) => {
          const style = {
            position: "absolute",
            bottom: `-${m.height / 1.2}px`,
            left: m.left,
            width: `${m.width}px`,
            height: `${m.height}px`,
            background: `radial-gradient(circle at 50% 80%, #158b34 20%, #0f6f28 85%, #0b4d1e 100%)`,
            boxShadow: `0 20px 50px rgba(0, 0, 0, 0.4), inset 0 -20px 30px rgba(0, 0, 0, 0.5)`,
            borderRadius: "50% 50% 20% 20%",
            border: "8px solid rgba(0, 0, 0, 0.5)",
            zIndex: m.isFront ? 2 : 1
          };
          return <div key={i} style={style} />;
        })}
      </div>
      <div className="brick-wall"></div>
      <div className="sun">
        {rays}
      </div>
      <div className="fullscreen-icon">
        <div className="hitbox" onClick={toggleFullscreen}></div>
        <div className="corner top-left"></div>
        <div className="corner top-right"></div>
        <div className="corner bottom-right"></div>
        <div className="corner bottom-left"></div>
      </div>
      <div className="water">
        <svg viewBox="0 0 1200 200" preserveAspectRatio="none">
          <path d="M0 50 C300 150, 900 0, 1200 100 L1200 200 L0 200 Z" fill="#0af">
            <animate attributeName="d" dur="10s" repeatCount="indefinite" values="M0 50 C300 150, 900 0, 1200 100 L1200 200 L0 200 Z; M0 55 C300 145, 900 5, 1200 95 L1200 200 L0 200 Z; M0 50 C300 150, 900 0, 1200 100 L1200 200 L0 200 Z" />
          </path>
          <g className="current-lines">
            <path d="M50,80 C100,70 150,90 200,80" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M50,80 C100,70 150,90 200,80;M50,80 C100,60 150,100 200,80;M50,80 C100,70 150,90 200,80" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M250,120 C300,110 350,130 400,120" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M250,120 C300,110 350,130 400,120;M250,120 C300,100 350,140 400,120;M250,120 C300,110 350,130 400,120" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M450,100 C500,90 550,110 600,100" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M450,100 C500,90 550,110 600,100;M450,100 C500,80 550,120 600,100;M450,100 C500,90 550,110 600,100" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M650,140 C700,130 750,150 800,140" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M650,140 C700,130 750,150 800,140;M650,140 C700,120 750,160 800,140;M650,140 C700,130 750,150 800,140" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M850,160 C900,150 950,170 1000,160" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M850,160 C900,150 950,170 1000,160;M850,160 C900,140 950,180 1000,160;M850,160 C900,150 950,170 1000,160" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M1050,100 C1100,90 1150,110 1200,100" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M1050,100 C1100,90 1150,110 1200,100;M1050,100 C1100,80 1150,120 1200,100;M1050,100 C1100,90 1150,110 1200,100" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M100,150 C150,145 200,155 250,150" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M100,150 C150,145 200,155 250,150;M100,150 C150,135 200,165 250,150;M100,150 C150,145 200,155 250,150" dur="0.8s" repeatCount="indefinite"/>
            </path>
            <path d="M300,170 C350,165 400,175 450,170" stroke="white" strokeWidth="0.8" fill="none">
              <animateTransform attributeName="transform" type="translate" from="-100 0" to="1300 0" dur="4s" repeatCount="indefinite"/>
              <animate attributeName="d" values="M300,170 C350,165 400,175 450,170;M300,170 C350,155 400,185 450,170;M300,170 C350,165 400,175 450,170" dur="0.8s" repeatCount="indefinite"/>
            </path>
          </g>
        </svg>
      </div>
    </div>
  );
}
